lens_5.query:
q = load "${App.Datasets.ConsumerBanking_Opportunity_tp.FullyQualifiedName}";
q_A = filter q by 'IsClosed' == "false";
q_B = filter q by 'IsClosed' == "true" && 'IsWon' == "true";
q_C = filter q by 'ForecastCategory' != "Omitted" && 'IsClosed' == "false";
q_D = filter q by 'IsClosed' == "true";
result = group q_A by all full, q_B by all full, q_C by all full, q_D by all ;
result = foreach result generate count(q_A) as 'Open Opportunities', count(q_B) as 'Closed Won', (case when count(q_C) < 1 then 0 else coalesce(sum(q_C.'Amount'),0) end) as 'Open Pipe', coalesce(sum(q_B.'Amount'),0) as 'Closed Won Amount', coalesce(sum(q_B['Amount']),0) / coalesce(sum(q_D['Amount']),0) as 'Win Rate';
result = limit result 2000;

lens_6.query:
q = load "${App.Datasets.ConsumerBanking_Opportunity_tp.FullyQualifiedName}";
q = filter q by 'ForecastCategory' != "Omitted";
q = filter q by 'IsClosed' == "false";
q = group q by all;
q = foreach q generate (case when count() < 1 then 0 else coalesce(sum('Amount'),0) end) as 'sum_Amount';
q = limit q 2000;

lens_2.query:
q = load "${App.Datasets.ConsumerBanking_Lead_tp.FullyQualifiedName}";
q = filter q by 'RecordType.Name' == "Referral";
q_B = filter q by 'IsConverted' == "true";
result = group q by all full, q_B by all;
result = foreach result generate count(q) as 'A', count(q_B) as 'B', coalesce(count(q_B),0) / coalesce(count(q),0) as 'C', coalesce(sum(q_B['ConvertedOpp.Amount']),0) as 'D' ;
result = limit result 2000;
